INSERT INTO `faqs` (`id`, `question`, `answer`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'How can I use Zithex.com platform?', 'First, you need to register and to verify your email.', '2019-02-05 04:52:39', '2019-05-31 08:00:05', NULL),
(2, 'Does Zithex.com request verification of KYC?', 'Verification of KYC is needed if the user wishes to transact more than 5 bitcoins or more than 30,000 dollars or more than 25,000 Euro.', '2019-02-05 04:53:23', '2019-05-31 08:02:03', NULL),
(3, 'How can I deposit on Zithex.com platform?', 'To deposit on Zithex.com, first, you need to active your bitcoin wallet. You can do it by clicking on my profile - my wallets. You can also use Ethereum wallet and to deposit on any ETH cryptocurrency. At last, you can use debit visa card or master card, to make deposit in USD and EUR.', '2019-02-05 04:52:39', '2019-05-31 12:54:13', NULL),
(4, 'Which ways can I use to deposit?', 'The ways of deposit are the following:\r\n1. Bitcoin\r\n2. Ethereum or any other cryptocurrency\r\n3. EUR and USD debit Card.\r\n4. EUR and USD master Card.\r\n', '2019-02-05 04:53:23', '2019-05-31 12:56:44', NULL),
(5, 'Can I have more than one account with Zithex.com?', 'Yes, you can have unlimited accounts with Zithex.com.', '2019-02-05 04:52:39', '2019-05-31 12:58:06', NULL),
(6, 'Is there any limit of deposits or withdrawals?', 'Deposits and withdrawals depend from the verification – registration level of each user.', '2019-02-05 04:53:23', '2019-05-31 12:58:54', NULL),
(7, 'How long does it take to withdraw money from my crypto wallet?', 'One confirmation it\'s enough to appear your withdrawal in your wallet.', '2019-02-05 04:52:39', '2019-05-31 12:59:39', NULL),
(8, 'How long does it take to withdraw cash to my bank account or bank card?', 'Usually, it takes between 3 to 5 working days.', '2019-02-05 04:53:23', '2019-05-31 13:00:17', NULL),
(9, 'This is Question ', 'This is answer for 9 Questions', '2019-02-26 07:56:53', '2019-02-26 07:58:01', '2019-02-26 07:58:02'),
