(12, 'This is Question 9', 'kkldkls', '2019-04-18 06:33:55', '2019-04-18 06:34:29', '2019-04-18 06:34:30'),
(13, 'This is Question 9', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled', '2019-05-14 06:12:31', '2019-05-14 06:12:54', '2019-05-14 06:12:54'),
(14, 'Can a Zithex.com Trader trade for my behalf?', 'Yes, you can book a professional trader to trade for you, throw our 24/7 support live chat.', '2019-05-31 13:00:36', '2019-05-31 13:01:41', NULL),
(15, 'How can I trade with Zithex.com?', 'By clicking Trade/Exchange category from our menu bar, you can choose which\r\ncryptocurrency you wish to trade and in which currency pairing.', '2019-05-31 13:02:30', '2019-05-31 13:02:30', NULL),
(16, 'How can I exchange only?', 'By clicking Trade/Exchange category from our menu bar, you can choose the pairing you wish to Trade or Exchange.', '2019-05-31 13:03:11', '2019-05-31 13:03:11', NULL),
(17, 'What is the amount of fees that Zithex.com charge per transaction?', 'The fees depend from the registration level of each user. Higher registration level - lowest fees are existing. Zithex.com fees range from 0.030% to 0.050% per trade/exchange. Analytically:\r\n1. Level 1 has fees 0,050% per trade/exchange\r\n2. Level 2 has fees 0.040% per trade/exchange\r\n3. Level 3 has fees 0,030% per trade/exchange', '2019-05-31 13:16:39', '2019-05-31 13:16:39', NULL),
(18, 'How can I proceed in identification verification?', 'By clicking My Profile in the right upper corner of your screen, you can see the\r\nidentification levels of our company.', '2019-05-31 13:17:32', '2019-05-31 13:17:32', NULL),
(19, 'How to proceed to delete my account?', 'To delete your account, you need to contact our support live chat.', '2019-05-31 13:18:02', '2019-05-31 13:18:02', NULL),
(20, 'How can I change my account email?', 'To proceed on changing of account email, you need to contact our support live chat.', '2019-05-31 13:18:35', '2019-05-31 13:18:35', NULL),
(21, 'How can I unlock my account?', 'To unlock your account, you need to contact our support live chat.', '2019-05-31 13:19:12', '2019-05-31 13:19:12', NULL),
(22, 'How can I change my password?', 'You can change your password by clicking My Profile in the upper right corner of your screen.', '2019-05-31 13:20:26', '2019-05-31 13:20:26', NULL),
(23, 'How can I secure my account?', 'To be sure your account is in the highest level of security, you need to active Google Authentication, SMS Authentication and Anti-Phishing Code in My Profile.', '2019-05-31 13:21:04', '2019-05-31 13:21:04', NULL),
(24, 'Are there any fees for the deposits through Visa or Master Cards?', 'The fees through deposits with Visa or Master Cards are charged by the banks, not by Zithex Global.', '2019-05-31 13:21:44', '2019-05-31 13:21:44', NULL),
(25, 'How can i have a personal API Key?', 'For personal API Key, you need to contact our support live chat.', '2019-05-31 13:22:48', '2019-05-31 13:22:48', NULL);
