(2, 'terms_conditions', 'Terms and Conditions', '<p style=\"text-align: center; \"><strong>General Infos</strong></p><p style=\"text-align: center; \">This documentation, it provides a personal agreement between the user and Zithex Global (</p><p style=\"text-align: center; \">https://www.zithex.com ) By registering and verifying your account, you accept all the Term and</p><p style=\"text-align: center; \">Conditions of our company, and you confirm that you agree to use our services under the</p><p style=\"text-align: center; \">simple rules of Zithex Global. Also, you agree that you have read, understood and accepted all</p><p style=\"text-align: center; \">of the terms and conditions contained on this documentation. Any disagreement, please kindly</p><p style=\"text-align: center; \">stop using our services. At last, if you need further information, you can go through our support</p><p style=\"text-align: center; \">live chat or contact us at support@zithex.com or admin@zithex.com. You can also use any of</p><p style=\"text-align: center; \">our Social Media ways, to express your opinion or to ask anything you may need.</p><br><p style=\"text-align: center; \"><strong>Conditions of Documentation</strong></p><p style=\"text-align: center; \">Zithex Global can modify or change these terms and conditions of the present document at any</p><p style=\"text-align: center; \">time and provide the changes to all the users. Any changes automatically will get uploaded to</p><p style=\"text-align: center; \">our platform, will get announced on our News category, and we will forward personal emails to</p><p style=\"text-align: center; \">all the active users. User has the right to terminate his account any time he/she believes is</p><p style=\"text-align: center; \">better for him/her. Deleting your account can be done through our 24/7 live chat support.</p><br><p style=\"text-align: center; \"><strong>Age confirmation</strong></p><p style=\"text-align: center; \">By verifying your account with Zithex Global, you confirm that you are at least 18 years old, you</p><p style=\"text-align: center; \">are legal personality or organisation, and you can approve that any time. Zithex Global has the</p><p style=\"text-align: center; \">right to ask additional confirmation of the above if this is necessary under the justify of Zithex</p><p style=\"text-align: center; \">Global. Any misunderstanding from the user\'s side is not a company\'s responsibility, so make</p><p style=\"text-align: center; \">sure that you know English well.</p><br><p style=\"text-align: center; \"><strong>Who can use our services</strong></p><p style=\"text-align: center; \">Zithex Global is a whole world cryptocurrency, trading and exchange platform, based on Estonia</p><p style=\"text-align: center; \">regulation rules about cryptocurrency. It welcomes anyone from any country/islands all over the</p><p style=\"text-align: center; \">World.</p><p style=\"text-align: center; \">User can open an account and deposit cryptocurrency or fiat and use them for trading. Also,</p><p style=\"text-align: center; \">users allow exchanging cryptocurrency to order and the opposite. At last, users can withdraw</p><p style=\"text-align: center; \">their balances by using fiat currency or cryptocurrency.</p><br><p style=\"text-align: center; \"><strong>Zithex Global Services</strong></p><p style=\"text-align: center; \">Zithex Global is a cryptocurrency trading and exchange platform. Zithex Global provides online</p><p style=\"text-align: center; \">digital assets for trading. Also, giving fiat trading capabilities on its platform, it will be stringently</p><p style=\"text-align: center; \">regulated by the guidelines laid out by the local regulator/government of Estonia. Except for the</p><p style=\"text-align: center; \">trading services, Zithex Global, also offer, professional trading services, for users who are not</p><p style=\"text-align: center; \">able to trade for any reason. Our traders are having all the necessary knowledge to provide</p><p style=\"text-align: center; \">trading services, as much accuracy as possible.</p><p style=\"text-align: center; \">Zithex Global Registrations and Requirements</p><p style=\"text-align: center; \">Anyone interested in using Zithex Global services must register and confirm their email using</p><p style=\"text-align: center; \">https://www.zithex.com. To create an account, Zithex Global requests your email and a personal</p><p style=\"text-align: center; \">password. On My Profile Users can add additional details if they want to do that. Zithex Global</p><p style=\"text-align: center; \">offers three (3) different levels for trading.</p><p style=\"text-align: center; \">The level number 1 does not request anything more than user uses to create his/her personal</p><p style=\"text-align: center; \">account. For levels number 2 and number 3, Zithex Global requires document verification</p><p style=\"text-align: center; \">(KYC). Further details users can find out on My Profile category, after the completing of main</p><p style=\"text-align: center; \">registration. For KYC verification, Zithex Global can request Passport, ID identify, proof of</p><p style=\"text-align: center; \">address and general personal details. In case of further request, Zithex Global can request from</p><p style=\"text-align: center; \">the user, additional documents if it is necessary for security reasons. Zithex Global acts</p><p style=\"text-align: center; \">according to the demands of Estonia Laws about cryptocurrencies and trading assets and is not</p><p style=\"text-align: center; \">a personal request from the company. In case that users, for any reason, can not provide the</p><p style=\"text-align: center; \">additional requirements, Zithex Global has the right to refuse to give any services, has the right</p><p style=\"text-align: center; \">to froze user account or to delete it, if it is necessary.</p><br><p style=\"text-align: center; \"><strong>Account Control</strong></p><p style=\"text-align: center; \">Zithex Global allows users to create as many accounts they wish. Those accounts can be used</p><p style=\"text-align: center; \">only by those to whom they are registered. In case that Zithex Global proofs that accounts are</p><p style=\"text-align: center; \">getting used by the non-real holder, or from a non-real person, has the right to froze or to delete</p><p style=\"text-align: center; \">those accounts, without further warning or explanation.</p><p style=\"text-align: center; \"><br></p><p style=\"text-align: center; \"><strong>Security</strong></p><p style=\"text-align: center; \">Zithex Global priority is to keep safe users details and funds. For this, we implement, and we will</p><p style=\"text-align: center; \">always continue to maintain them and to make them safer. Users needed to understand that the</p><p style=\"text-align: center; \">security of their accounts and funds also depend from their behaviour. Users required to keep in</p><p style=\"text-align: center; \">mind that will never share any detail connect with their account and also follow all the security</p><p style=\"text-align: center; \">instruction we provide through our platform, by activating the secure functionalities in their</p><p style=\"text-align: center; \">profiles.</p><p style=\"text-align: center; \">Users agree that they :</p><p style=\"text-align: center; \">a) Will inform Zithex Global, in case they notice any suspicious movements on their account.</p><p style=\"text-align: center; \">b) Will strictly activate all the offered security functionalities, once they get registered with</p><p style=\"text-align: center; \">Zithex Global.</p><p style=\"text-align: center; \">c) Will log out from their accounts when they do not use them.</p><p style=\"text-align: center; \">Zithex Global is not responsible for any losses or issues to accounts, whose owners do not</p><p style=\"text-align: center; \">follow the above advice.</p><br><p style=\"text-align: center; \"><strong>Zithex Global pieces of advice and guides</strong></p><p style=\"text-align: center; \">Users hereby agree that:</p><p style=\"text-align: center; \">• All the activities on their account are done under the laws of their own country.</p><p style=\"text-align: center; \">• Users are responsible for keeping safe their accounts and following all the necessary</p><p style=\"text-align: center; \">steps for an extra secure account.</p><p style=\"text-align: center; \">• Users will not break any rules of Zithex Global.</p><p style=\"text-align: center; \">• Users will not violence any Term and Conditions of Zithex Global.</p><p style=\"text-align: center; \">• Users will not try to cheat Zithex Global by using any Robotic Methods, or any Hacking</p><p style=\"text-align: center; \">Methods by using malicious software or any other hacking ways.</p><p style=\"text-align: center; \">• Users are responsible for following all the taxes laws according to their countries.</p><p style=\"text-align: center; \">• Users will provide additional details in the case that Zithex Global ask for it for any</p><p style=\"text-align: center; \">security reasons.</p><p style=\"text-align: center; \">By verifying your account, you agree that :</p><p style=\"text-align: center; \">Zithex Global has all the rights to unilaterally determine whether you have violated any of the</p><p style=\"text-align: center; \">above covenants and take actions to apply relevant rules without receiving your consent or</p><p style=\"text-align: center; \">giving prior notice to you. Such actions are :</p><p style=\"text-align: center; \">• Frozen of account</p><p style=\"text-align: center; \">• Blocking of Account</p><p style=\"text-align: center; \">• Deleting of Account</p><p style=\"text-align: center; \">• Blocking of trading functionalities</p><p style=\"text-align: center; \">• Reporting to Authorities</p><p style=\"text-align: center; \">Users must make sure they read all the above responsibilities and actions before to use Zithex</p><p style=\"text-align: center; \">Global services.</p><br><p style=\"text-align: center; \"><strong>Services Fees</strong></p><p style=\"text-align: center; \">Zithex Global has the right under the laws of Estonia authorities to charge services fees to all</p><p style=\"text-align: center; \">the users based on their registration level and according to the activities of users. Also has the</p><p style=\"text-align: center; \">right to change the number of payments any time if the company believes it is necessary and</p><p style=\"text-align: center; \">under the requirements laws.</p><br><p style=\"text-align: center; \"><strong>Services Provision</strong></p><p style=\"text-align: center; \">Zithex Global does not offer any form of agreement about the warranty regarding the services</p><p style=\"text-align: center; \">connected with stability, accuracy and completeness about the involved technologies. Zithex</p><p style=\"text-align: center; \">Global cannot control the legalities of any coin and the info which combined with each one.</p><p style=\"text-align: center; \">Third parties companies who own any currency are responsible for the above, and users must</p><p style=\"text-align: center; \">get informed about the coin which they are interested in trading or investing before proceeding</p><p style=\"text-align: center; \">in any transaction. Zithex Global is responsible for controlling – maintain – keep in safety, the</p><p style=\"text-align: center; \">entire platform, the funds of users and their details (data?). Zithex Global can proceed to an</p><p style=\"text-align: center; \">investigation about a possible case inside platform but not outside of it and not for what is not</p><p style=\"text-align: center; \">connect with the company.</p><br><p style=\"text-align: center; \"><strong>Limitations</strong></p><p style=\"text-align: center; \">Zithex Global is not responsible for any losses that may come out by the following:</p><p style=\"text-align: center; \">• Failed to use Zithex Global services because of not good knowledge.</p><p style=\"text-align: center; \">• Misunderstanding of Zithex Global\'s services.</p><p style=\"text-align: center; \">• Losses which are coming out not because of Zithex Global attributes.</p><p style=\"text-align: center; \">• Losses of profits or any other intangible losses.</p><p style=\"text-align: center; \">• Damages arose out from bad use of your account.</p><p style=\"text-align: center; \">Zithex Global can proceed in any investigation for kind of losses which don\'t connect with any</p><p style=\"text-align: center; \">from the above cases, and only if the user informs the company not later than 24 hours after the</p><p style=\"text-align: center; \">possible case.</p><br><p style=\"text-align: center; \"><strong>Compensation</strong></p><p style=\"text-align: center; \">Zithex Global is responsible for compensating any amount of funds, in case that it would be</p><p style=\"text-align: center; \">proven that kind of losses came out because of the company\'s responsibilities. No one kind of</p><p style=\"text-align: center; \">recompense can be given to the user if the responsibility for the possible losses is coming out</p><p style=\"text-align: center; \">because of users bad control of the account. Any recompensation demands additional</p><p style=\"text-align: center; \">investigation before any decision.</p><br><p style=\"text-align: center; \"><strong>Account Termination</strong></p><p style=\"text-align: center; \">Zithex Global has the right to:</p><p style=\"text-align: center; \">• Block any account and its funds</p><p style=\"text-align: center; \">• Suspend any account and its funds</p><p style=\"text-align: center; \">• Lock any account and its funds</p><p style=\"text-align: center; \">• Freeze any account and its funds</p><p style=\"text-align: center; \">• Delete any account</p><p style=\"text-align: center; \">If we suspect any from the following:</p><p style=\"text-align: center; \">• Detection of unusual activity in the account</p><p style=\"text-align: center; \">• Detection of unauthorised access to the account</p><p style=\"text-align: center; \">• Criminal investigation</p><p style=\"text-align: center; \">• Governmental order</p><p style=\"text-align: center; \">• Hacking trials</p><p style=\"text-align: center; \">In case that any the above accounts, has remaining funds, those funds will return to the user</p><p style=\"text-align: center; \">after the investigation gets completed. After the finishing of the investigation, the user has fifteen</p><p style=\"text-align: center; \">(15) (days, weeks?) to withdraw the funds from the account. Users do not have the right to</p><p style=\"text-align: center; \">withdraw any remaining funds from their accounts if those accounts get terminate because of</p><p style=\"text-align: center; \">Hacking Trials.</p><br><p style=\"text-align: center; \"><strong>Local Laws</strong></p><p style=\"text-align: center; \">Users are responsible for following their local laws which are connected with services, similar to</p><p style=\"text-align: center; \">Zithex Global. Zithex Global is not responsible if the user faces kind of issue with his/her local</p><p style=\"text-align: center; \">authorities about those activities.</p><br><p style=\"text-align: center; \"><strong>Funds and Sources</strong></p><p style=\"text-align: center; \">Users confirm that any amount of funds transacted from their accounts are legal and legitimate</p><p style=\"text-align: center; \">sources and are not coming out from illegal activities. Zithex Global has the right to investigate</p><p style=\"text-align: center; \">the deposited funds if we suspect unlawful activities, or in case we have Criminal or</p><p style=\"text-align: center; \">Governmental order from user\'s Local Authorities. User is not going to lose their funds in such</p><p style=\"text-align: center; \">kind of situations. The only reason users lose any funds is to get proved that those kinds of</p><p style=\"text-align: center; \">activities they had targeted the interests of Zithex Global.</p><br><p style=\"text-align: center; \"><strong>For Zithex Global</strong></p><p style=\"text-align: center; \"><strong>The CEO</strong></p><p style=\"text-align: center; \"><strong>Natalia Krupenko</strong></p>', '2019-02-05 05:07:51', '2019-05-31 07:57:20', NULL),
