(12, 'about', 'About', '<p style=\"text-align: center; \">In 2010 was the first time we heard about Bitcoin, about cryptocurrency. Trying to investigate</p><p style=\"text-align: center; \">and understand the plan, the functions, the technologies behind this new \'\'thing\'\', we realised</p><p style=\"text-align: center; \">that we had to do a new way of transacting money, a new way to increase your cash.</p><p style=\"text-align: center; \">We understand that we talk about an asset with a strong capacity to become something</p><p style=\"text-align: center; \">Globally substantial and famous. The anonymity behind this asset and generally the advantages</p><p style=\"text-align: center; \">that were providing this technology, made us try this kind of investment. We were lucky because</p><p style=\"text-align: center; \">we were a team of people who were working on Forex products. People who knew what trading</p><p style=\"text-align: center; \">was and how to survive in such kind of market.</p><p style=\"text-align: center; \">Finally, after almost ten (10) years, we are here to provide our knowledge, to offer our services,</p><p style=\"text-align: center; \">and to support this technology by launching our cryptocurrency trading, exchange and</p><p style=\"text-align: center; \">investment platform Zithex Global or better https://www.zithex.com.</p><p style=\"text-align: center; \">What is Zithex Global and who we are</p><br><p style=\"text-align: center; \">Zithex.com is cryptocurrency trading, exchanging and investment platform, that belongs to</p><p style=\"text-align: center; \">Zithex Global company. Zithex Global company is officially registered Public Company in</p><p style=\"text-align: center; \">Estonia and based in Tallinn. As all of you know, the last years Estonia become one of the most</p><p style=\"text-align: center; \">friendly countries, accepting cryptocurrency companies, officially.</p><p style=\"text-align: center; \">Zithex.com is a long term vision project that finally comes true. Our target is to offer a high</p><p style=\"text-align: center; \">exchange price for all the cryptocurrencies, with low exchange and trade fees.</p><p style=\"text-align: center; \">Zithex.com is here to offer all the necessary services are needed, clients to have more secure,</p><p style=\"text-align: center; \">more comfortable and more profitable trading and exchange way.</p><p style=\"text-align: center; \">Zithex.com is friendly with all the countries and is here to welcome anyone interested to use our</p><p style=\"text-align: center; \">services.</p><p style=\"text-align: center; \">Our team well informed with anything connected with the cryptocurrency world, as all the</p><p style=\"text-align: center; \">members they have more than seven years experiences on this market.</p><p style=\"text-align: center; \">We are in a position to offer, trading services of the most popular cryptocurrencies, exchange</p><p style=\"text-align: center; \">services for all the well-known cryptocurrencies. Also, our professional traders are here to</p><p style=\"text-align: center; \">advise you the best choice of the crypto market at the current moment, for long or short term</p><p style=\"text-align: center; \">according to the market signals.</p><p style=\"text-align: center; \">We will be glad to welcome you at any time. Feel free to ask anything you need to know before</p><p style=\"text-align: center; \">to trade, to invest or to exchange any cryptocurrency. Our support live chat is 24/7 available for</p><p style=\"text-align: center; \">you.</p><p style=\"text-align: center; \">Welcome to Zithex.com</p><p style=\"text-align: center; \">Kind Regards,</p><p style=\"text-align: center; \">The CEO of Zithex.com</p><p style=\"text-align: center; \">Natalia Krupenko</p><p style=\"text-align: center; \"><img src=\"https://www.linkedin.com/in/natalia-krupenko-480286179/\" alt=\"\"><br></p><br>', '2019-02-05 05:07:51', '2019-05-31 07:49:54', NULL),
