(18, 'Zithex Global Senior Lawyer', 'Jeff Hausman', 'Experience Senior Lawyer with demostration history of working and representing clients in criminal and civil litigation and other legal proceedings, draw up legal documents, and manage or advise clients on legal transactions.\r\nLaw degrees on LLM, MCL and MCJ by university of Los Angeles - United States.', '1560238198966.png', '2019-06-11 07:28:37', '2019-06-11 07:41:06', NULL),
(19, 'Zithex Global Lawyer', 'Kevin Robbins', 'Experience lawyer with demostration history to involve interpreting laws and regulations for individuals and corporate organizations. Analyze the likely outcome of clients’ cases as well as defend clients in the law court.\r\nHe also obtain information and evaluate findings to support arguments in court, and develop strategies and counter strategies to win court cases. Degree on LLM at New York University - School of Law.', '1560238286036.jpeg', '2019-06-11 07:31:26', '2019-06-11 07:47:38', NULL),
(20, 'Zithex Global Lawyer', 'Irina Yakovenko', 'Experience lawyer with demostration history to advise and represent clients in courts, before government agencies, and in private legal matters. Conduct research and analysis of legal problems. Interpret laws, rulings, and regulations for individuals and businesses. Bachelor LLM at Freie University of Berlin - Institute for German and European Business, Competition and Regulatory Law', '1560241422918.jpeg', '2019-06-11 08:23:42', '2019-06-11 08:33:40', NULL),
(21, 'Zithex Global Lawyer', 'Alexandra Grigorievna', 'Experience lawyer with demostration history to present facts in writing and verbally to their clients or others and argue on their behalf. Prepare and file legal documents, such as lawsuits, appeals, wills, contracts, and deeds. Also, handle a variety of tax-related issues for individuals and corporations. University of California, Berkeley Law.', '1560241570684.jpeg', '2019-06-11 08:26:10', '2019-06-11 08:44:03', NULL),
(22, 'Zithex Global Senior Lawyer', 'James Bramnick', 'Experience lawyer with demostration history to deal with the laws related to inventions, patents, trademarks, and creative works, such as music, books, and movies. Also to advise a client about whether it is okay to use published material in the client’s forthcoming book. Works on legal issues arising from the buying and selling of stocks, ensuring that all disclosure requirements are met. Advising corporations that are interested in listing in the stock exchange through an initial public offering (IPO) or buying shares in another corporation. Bachelor Degrees on  on LLM, MCL and MCJ by university of Pennsylvania (UPenn) Law School - Penn Law.', '1560241740126.jpeg', '2019-06-11 08:29:00', '2019-06-11 08:59:25', NULL);
